* {
    box-sizing: border-box;
}

html, body {
    width: 100%;
    height: 100vh;
    margin: 0;
    padding: 0;
    background-color: #fff;
}

.container {
    width: 100%;
    height: 100%;
    float: left;
    display: block;
}

.breadcrumb {
    float: left;
    display: block;
    width: 100%;
    height: 50px;
    padding: 10px 20px;
    border-bottom: 1px solid #ddd;
}

.tree, .mainframe {
    float: left;
    display: block;
    height: calc(100% - 50px);
}

.tree {
    width: 20%;
    border-right: 1px solid #ddd;
    padding: 20px;
}

.tree .tree-folder {
    user-select: none;
    cursor: pointer;
}

.tree .list {
    list-style-type: none;
    padding-left: 15px;
}

.tree .list.tree-root {
    margin: 0;
    padding-left: 0;
}

.tree .list .item {
    line-height: 1.4;
}

.tree .list .item .tree-icon {
    position: absolute;
    width: 30px;
    height: 20px;
    line-height: 20px;
    text-align: center;
    left: 0;
    top: 50%;
    font-size: .85em;
    transform: translateY(-50%);
}

.tree .list .item .tree-icon::before {
    font-family: Font Awesome\ 5 Free;
}

.tree .list .item.tree-folder,
.tree .list .item.tree-file {
    position: relative;
    padding-left: 30px;
}

.tree .list .item.tree-folder.is-active,
.tree .list .item.tree-file.is-active {
    background-color: #0f91ff;
    color: #fff;
}

.tree .list .item.tree-folder .tree-icon {
    cursor: pointer;
}

.tree .list .item.tree-folder .tree-icon::before {
    content: '\f07b'
}

.tree .list .item.tree-file .tree-icon::before {
    content: '\f15b';
}

.tree .list .item.tree-folder.is-open .tree-icon::before {
    content: '\f07c'
}

.tree .tree-folder + .list {
    display: none;
}

.tree .tree-folder + .list.is-visible {
    display: block;
}

.mainframe {
    display: block;
    float: left;
    width: 80%;
}

.mainframe .mainframe-list {
    display: block;
    float: left;
    width: 75%;
    border-right: 1px solid #ddd;
    height: 100%;
    padding: 20px;
}

.mainframe .mainframe-details {
    display: block;
    float: right;
    width: 25%;
    height: 100%;
    padding: 20px;
}

.mainframe .mainframe-item {
    display: block;
    line-height: 1.6;
    cursor: pointer;
}

.mainframe .mainframe-item .mainframe-item-icon {
    margin-right: 5px;
}
